export default function SearchResults({ results }){
    return(
        <div>
        {results?.map((value)=>{
            return(
                <div key={value.id}>
                    <p>{value.name}</p>
                    <p>{value.email}</p>
                </div>

            );
        })};
        </div>
    );
}
